import{_ as c}from"./Backbutton.55827dc5.js";import{a as n,b as d,e,f as t,h as r,o}from"./entry.18959fe1.js";const i={id:"pv"},v={class:"container"},s=r("<p data-v-5cdc9dc2><b data-v-5cdc9dc2> Privacyverklaring voor Rocketsourcers:</b><br data-v-5cdc9dc2> Rocketsourcers respecteert en beschermt de privacy van de individuen die gebruik maken van onze website en onze diensten. Dit privacybeleid legt uit welke soorten persoonlijke gegevens we verzamelen en hoe we deze informatie gebruiken, delen en beschermen.<br data-v-5cdc9dc2><br data-v-5cdc9dc2><b data-v-5cdc9dc2>Welke informatie verzamelen we?</b><br data-v-5cdc9dc2> We verzamelen persoonlijke informatie die je vrijwillig aan ons verstrekt, zoals je naam, e-mailadres en telefoonnummer, wanneer je een formulier invult op onze website of contact met ons opneemt.<br data-v-5cdc9dc2><br data-v-5cdc9dc2> We verzamelen ook automatisch informatie over je gebruik van onze website, zoals je IP-adres, browserinformatie, en de pagina&#39;s die je hebt bezocht, door het gebruik van cookies. Lees ons cookiebeleid voor meer informatie hierover.<br data-v-5cdc9dc2><br data-v-5cdc9dc2><b data-v-5cdc9dc2>Hoe gebruiken we deze informatie?</b><br data-v-5cdc9dc2> We gebruiken de verzamelde informatie om:<br data-v-5cdc9dc2><br data-v-5cdc9dc2> - Onze diensten aan te bieden en te verbeteren;<br data-v-5cdc9dc2> - Je vragen te beantwoorden en met je te communiceren;<br data-v-5cdc9dc2> - Onze website te analyseren en te optimaliseren;<br data-v-5cdc9dc2> - Te voldoen aan wettelijke verplichtingen en onze rechten te beschermen.<br data-v-5cdc9dc2><br data-v-5cdc9dc2><b data-v-5cdc9dc2>Met wie delen we deze informatie?</b><br data-v-5cdc9dc2> We delen je persoonlijke informatie niet met derden, tenzij dit nodig is om onze diensten te verlenen, te voldoen aan de wet, of met jouw expliciete toestemming.<br data-v-5cdc9dc2><br data-v-5cdc9dc2><b data-v-5cdc9dc2>Jouw rechten</b><br data-v-5cdc9dc2> Je hebt het recht om op elk moment inzage, correctie, verwijdering en beperking van je persoonsgegevens aan te vragen. Ook kun je bezwaar maken tegen de verwerking van je gegevens. Neem contact met ons op via info@rocketsourcers.nl om deze rechten uit te oefenen.<br data-v-5cdc9dc2><br data-v-5cdc9dc2><b data-v-5cdc9dc2> Beveiliging van je gegevens </b><br data-v-5cdc9dc2> We hebben passende technische en organisatorische maatregelen genomen om je persoonsgegevens te beveiligen tegen onrechtmatige verwerking.<br data-v-5cdc9dc2><br data-v-5cdc9dc2><b data-v-5cdc9dc2>Wijzigingen in deze privacyverklaring</b><br data-v-5cdc9dc2> Rocketsourcers behoudt zich het recht voor om wijzigingen aan te brengen in deze privacyverklaring zonder voorafgaande kennisgeving. We raden je aan om deze pagina regelmatig te controleren op eventuele wijzigingen.<br data-v-5cdc9dc2><br data-v-5cdc9dc2><b data-v-5cdc9dc2>Contact</b><br data-v-5cdc9dc2> Als je vragen of opmerkingen hebt over ons privacybeleid, neem dan contact met ons op via info@rocketsourcers.nl.<br data-v-5cdc9dc2><br data-v-5cdc9dc2> Laatste update: 4 augustus 2023. </p>",1),b={__name:"privacyverklaring",setup(m){return(g,l)=>{const a=c;return o(),d("div",null,[e("section",i,[e("div",v,[s,t(a)])])])}}},u=n(b,[["__scopeId","data-v-5cdc9dc2"]]);export{u as default};
